import Login from './login.js';
import Signup from './signup.js';
import Startpage from './startpage.js';
import {useState} from 'react';
const Container=()=>{
    let [chk,setChk]=useState(0);
    return (
        <div>
        <nav className="teal lighten-1">
            <span className="brand-logo" > Fun Room </span>
            <ul>
                <li> <a href="/" onClick={setChk(0)}>Home</a> </li>
                <li> <a href="/">About Us </a> </li>
            </ul>
            <ul className="right">
               <li> <a href="/" onClick={setChk(1)}> Login </a> </li>
                <li> <a href="/" onClick={setChk(2)}> Signup </a> </li>
            </ul>
        </nav>
            {
                chk===0?<Startpage/>:chk===1?<Login/>:<Signup/>
            }
        </div>
    );
}
export default Container;
